import React, { useEffect } from 'react'
import axios from 'axios'
const Prueba = () =>{

    useEffect(()=>{
        axios.get("https://peticiones.online/api/products")
        .then(({data:data}) => console.log(data))
        .catch(error => console.log(error))
    },[])
    return <div>
        Hola
    </div>
}

export default Prueba
